contract MetaDogs is ERC721Enum, Ownable, ReentrancyGuard {
	using Strings for uint256;
	string public baseURI;
	//sale settings
	uint256 public cost = 0.08 ether;
    uint256 public freeSupply = 1000;
	uint256 public maxSupply = 5000;
	uint256 public maxMint = 10;
    address private dev = 0x66C1e48f92a6CD8c5F65C30EF6b9f8951C040D22;
    address private marketing = 0x0c4C0DA60A3E137b97413B646a419688cc5B1274;
    address private company = 0x29c58c85f2c5d9f0624c770E332a8C09E12C547E;
	bool public status = false;

	constructor(
	string memory _name,
	string memory _symbol,
	string memory _initBaseURI
	) ERC721(_name, _symbol){
	setBaseURI(_initBaseURI);
	}
	// internal
	function _baseURI() internal view virtual returns (string memory) {
	return baseURI;
	}
	function Mint(uint256 _mintAmount) public nonReentrant{
	uint256 s = totalSupply();
	require(!status, "Off" );
	require(_mintAmount > 0, "0" );
	require(_mintAmount <= maxMint, "Too many" );
	require(s + _mintAmount <= freeSupply, "Max" );
	for (uint256 i = 0; i < _mintAmount; ++i) {
	_safeMint(msg.sender, s + i, "");
	}
	delete s;
	}
	function mint(uint256 _mintAmount) public payable nonReentrant{
	uint256 s = totalSupply();
	require(status, "Off" );
	require(_mintAmount > 0, "0" );
	require(_mintAmount <= maxMint, "Too many" );
	require(s + _mintAmount <= maxSupply, "Max" );
	require(msg.value >= cost * _mintAmount);
	for (uint256 i = 0; i < _mintAmount; ++i) {
	_safeMint(msg.sender, s + i, "");
	}
	delete s;
	}
	function adminMint(address[] calldata recipient) external onlyOwner{
	uint256 s = totalSupply();
	require(s + recipient.length <= maxSupply, "Too many" );
	for(uint i = 0; i < recipient.length; ++i){
	_safeMint(recipient[i], s++, "" );
	}
	delete s;	
	}
	function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
	require(_exists(tokenId), "ERC721Metadata: Nonexistent token");
	string memory currentBaseURI = _baseURI();
	return bytes(currentBaseURI).length > 0	? string(abi.encodePacked(currentBaseURI, tokenId.toString())) : "";
	}
	function setCost(uint256 _newCost) public onlyOwner {
	cost = _newCost;
	}
	function setMaxMintAmount(uint256 _newMaxMintAmount) public onlyOwner {
	maxMint = _newMaxMintAmount;
	}
	function setBaseURI(string memory _newBaseURI) public onlyOwner {
	baseURI = _newBaseURI;
	}
	function setSaleStatus(bool _status) public onlyOwner {
	status = _status;
	}
	function withdraw() public onlyOwner {
    (bool _dev, ) = payable(dev).call{value: address(this).balance*20/100}("");
    require(_dev);
    (bool _marketing, ) = payable(marketing).call{value: address(this).balance*3125/10000}("");
    require(_marketing);
    (bool _company, ) = payable(company).call{value: address(this).balance}("");
    require(_company);
	}
    function setmaxSupply(uint256 _newMaxSupply) public onlyOwner {
	maxSupply = _newMaxSupply;
	}
    function setFreeSupply(uint256 _newSupply) public onlyOwner {
	freeSupply = _newSupply;
	}
}
